import Layout from "../../Layout";
import BunbohueJSON from "../../Data/Food/Bunbohue";

const Bunbohue = (props) => {
  return Layout({ page: BunbohueJSON, rootImgPath: "Img/Food/Bunbohue/" });
};

export default Bunbohue;
